import React from 'react';

const Precio = (props) => {
    return (
        <div className="card text-white bg-primary mb-3">
            <div className="card-header">Precio de Bitcoin</div>
            <div className="card-body">
                <h4 className="card-title">Precio Actual</h4>
            </div>
        </div>
    );
};

export default Precio;
